import React from 'react';
import style from './mainPageLayout.css'

export default function MainPageLayout(props) {
  const h2Heading = props.h2;
  const pText = props.text;
  return (
    <div>
    <section className={style.allIn}>
      <h2 className={style.lol}>{h2Heading}</h2>
      <p>{pText}</p>
    </section></div>
  );
}
